content.css:
.container {
  width: auto;
  height: 100%;
}
.unlicensed-text {
  position: absolute;
  right: 45px;
  top: 8px;
  flex-wrap: nowrap;
  color: red;
}
.dialog {
  display: flex;
  position: absolute;
  right: 10px;
  left: 10px;
  top: 10px;
  bottom: 10px;
  flex-direction: column;
  justify-content: center;
  z-index: 10;
}
.dialog-content {
  padding: 1em;
  background: white;
  box-shadow: 0px 0 15px 0 #bbbbbb;
  display: flex;
  flex-direction: column;
  overflow-y: auto;
  position: relative;
}
.dialog-action {
  align-self: flex-end;
}
.logo {
  align-self: center;
}
.close {
  width: 75px;
  padding: 5px;
  border: 1px solid gray;
  outline: none;
}
.ccde-input {
  width: 100%;
  height: 32px;
  padding: 7px;
  border-radius: 0;
  border: 1px solid #8A8886;
  box-sizing: border-box;
}
.ccde-input[type='color'] {
  width: 56px;
  height: 32px;
  padding: 3px;
}
.ccde-btn {
  border: 1px solid #8A8886;
  padding: 5px 10px;
  background-color: #eaeaea;
  box-sizing: border-box;
  cursor: pointer;
  height: 32px;
}
.ccde-btn:hover {
  background-color: #8A8886;
}
.ccde-btn:focus {
  outline-offset: -3px;
}
.ccde-btn:disabled {
  background-color: #f4f4f4;
  pointer-events: none;
  cursor: default;
  opacity: 0.6;
}
.ccde-btn-group {
  display: flex;
}
.ccde-btn-group .ccde-btn {
  padding: 5px;
  background-color: transparent;
  width: 32px;
}
.ccde-btn-group .ccde-btn.selected {
  background-color: #8A8886;
}
.ccde-btn-group .ccde-btn:first-child {
  border: 1px solid #8A8886;
  border-right: none;
}
.ccde-btn-group .ccde-btn:not(:last-child):not(:first-child) {
  border: 1px solid #8A8886;
}
.ccde-btn-group .ccde-btn:last-child {
  border: 1px solid #8A8886;
  border-left: none;
}
.ccde-btn-delete {
  width: 32px;
  background-repeat: no-repeat;
  background-position: center;
  background-image: url(data:image/png;base64,);
}
.ccde-btn-down {
  width: 32px;
  background-repeat: no-repeat;
  background-position: center;
  background-image: url(data:image/png;base64,);
  transform: rotate(180deg);
}
.ccde-btn-up {
  width: 32px;
  background-repeat: no-repeat;
  background-position: center;
  background-image: url(data:image/png;base64,);
}
.ccde-btn-left {
  width: 32px;
  background-repeat: no-repeat;
  background-position: center;
  background-image: url(data:image/png;base64,);
  transform: rotate(-90deg);
}
.ccde-btn-right {
  width: 32px;
  background-repeat: no-repeat;
  background-position: center;
  background-image: url(data:image/png;base64,);
  transform: rotate(90deg);
}
.ccde-select {
  border: 1px solid #8A8886;
  padding: 5px;
  height: 32px;
  outline: none;
}
.ccde-list {
  border: 1px solid #eaeaea;
  display: flex;
  flex-direction: column;
  overflow-y: auto;
}
.ccde-list-item {
  padding: 0px 5px;
  box-sizing: border-box;
  height: 32px;
  line-height: 32px;
  text-overflow: ellipsis;
  overflow: hidden;
  cursor: pointer;
  width: 100%;
}
.ccde-list-item:hover {
  background-color: #edebe9;
}
.ccde-list-item.selected {
  background-color: #FFD004;
}
tr:nth-child(even) {
  background-color: #edebe9;
}
.toolbar {
  display: flex;
  border-bottom: 1px solid #eaeaea;
}
.toolbar .toolbar-button {
  padding: 5px;
  display: flex;
  align-items: center;
  background: transparent;
  border: none;
  cursor: pointer;
}
.toolbar .toolbar-button:hover {
  background-color: #eaeaea;
}
.toolbar .toolbar-button-icon {
  width: 20px;
}
.lp-btn {
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 10px;
  padding: 10px;
  border: 1px solid transparent;
  background-color: transparent;
  cursor: pointer;
  font-size: inherit;
}
.lp-btn:hover {
  border: 1px solid #8A8886;
  background-color: #eaeaea;
}
.lp-btn:focus {
  outline-offset: -3px;
  background-color: #eaeaea;
}
.visual-info-footer {
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
  padding-top: 10px;
  margin-top: 10px;
  border-top: 1px solid #dadce0;
}
.bi-dialog-content {
  user-select: none;
  font-family: "Segoe UI", "Segoe UI Web (West European)", -apple-system, BlinkMacSystemFont, Roboto, "Helvetica Neue", "sans-serif";
  font-size: 14px;
  font-weight: 400;
  color: rgba(0, 0, 0, 0.87);
}
/* simple flex grid*/
.flex-row {
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: flex-start;
  margin-bottom: 5px;
}
.flex-column-1 {
  flex: 0 1 10%;
}
.flex-column-2 {
  flex: 0 1 20%;
}
.flex-column-3 {
  flex: 0 1 30%;
}
.flex-column-4 {
  flex: 0 1 40%;
}
.flex-column-5 {
  flex: 0 1 50%;
}
.flex-column-6 {
  flex: 0 1 60%;
}
.flex-column-7 {
  flex: 0 1 70%;
}
.flex-column-8 {
  flex: 0 1 80%;
}
.flex-column-9 {
  flex: 0 1 90%;
}
.flex-column-10 {
  flex: 0 1 100%;
}
